class Solution(object):
    def updateMatrix(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: List[List[int]]
        """
        m, n = len(matrix), len(matrix[0])
        res = [[None for _ in range(n)] for _ in range(m)]
        for x in range(m):
            for y in range(n):
                if not matrix[x][y]:
                    res[x][y] = 0
                else:
                    queue = [[x, y]]
                    count = 0
                    while queue:
                        l = len(queue)
                        count += 1
                        flag = False
                        for _ in range(l):
                            xa, ya = queue.pop(0)
                            for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
                                xi = xa + dx
                                yi = ya + dy
                                if 0 <= xi < m and 0 <= yi < n:
                                    if matrix[xi][yi]:
                                        queue.append([xi, yi])
                                    if not matrix[xi][yi]:
                                        if not flag:
                                            res[x][y] = count
                                        flag = True
                        if flag:
                            break
        return res




